// SPDX-License-Identifier: MIT

pragma solidity ^0.8.16;

import "../node_modules/@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Strings.sol";

contract MyToken is ERC1155, Ownable {
    using Strings for uint256;

    // Roles and Mapping for the Hospital Environment
    enum RoleType { Undefined, Doctor, Assistant, Patient }
    mapping(uint256 => RoleType) public tokenRoles;

    // Access rights within each Hospital
    struct HospitalAccess {
        uint256 hospitalId;
        bytes accessRights;
    }
    mapping(uint256 => HospitalAccess[]) public tokenHospitalAccessRights;  

    // Attribute assignement to each User
   struct Attribute {
        string key;
        string value;
        bytes permissions; // A bytes array to hold multiple permissions
    }

    mapping(uint256 => Attribute[]) public tokenAttributes;

    // EMR Hash for each User
    struct EMRHash {
        bytes32 hash; // The hash of the EMR data
        uint256 lastUpdated; // Timestamp of the last update
        // ... any other relevant information
    }
    // Mapping from token ID (representing a user) to their EMR hash
    mapping(uint256 => EMRHash) public emrHashes;

    // Data associated to every person 
    struct PersonalData {
        string name;
        string surname;
        uint256 age;
    }
    mapping(uint256 => PersonalData) public tokenPersonalData;

 

    // Counters for each role category
    uint256 private doctorCounter = 0;
    uint256 private assistantCounter = 0;
    uint256 private patientCounter = 0;

    uint256 private tokenIdCounter = 0;

    // Define hospital identifiers as constants
    uint256 private constant H1 = 1;
    uint256 private constant H2 = 2;
    uint256 private constant H3 = 3;
    uint256 private constant H4 = 4;

    constructor() ERC1155("https://ipfs.io/ipfs/bafybeihjjkwdrxxjnuwevlqtqmh3iegcadc32sio4wmo7bv2gbf34qs34a/{id}.json") Ownable(0x12b405F1a1a4A11479E670E0af39312E771Ff38F) {
        // The owner is set as the deployer of the contract
    }

    // Define constants for each permission bit
    uint8 constant PERMISSION_READ_HISTORY = 0x01;
    uint8 constant PERMISSION_READ_PRESCRIPTIONS = 0x02;
    uint8 constant PERMISSION_READ_TEST_RESULTS = 0x04;
    uint8 constant PERMISSION_UPDATE_EMR = 0x08;  // Example new permission bit for updating EMR


    event TokenMinted(uint256 tokenId, RoleType role);



    // Functions to mint tokens for doctors, assistants, and patients
    function mintDoctor(address account, string memory name, string memory surname, uint256 age) public onlyOwner {
        tokenIdCounter++;
        _mint(account, tokenIdCounter, 1, "");
        tokenRoles[tokenIdCounter] = RoleType.Doctor;
        tokenPersonalData[tokenIdCounter] = PersonalData(name, surname, age);
        // Initialize with empty permissions
        initializeHospitalAccess(tokenIdCounter);

        // Inside the mint function
        emit TokenMinted(tokenIdCounter, RoleType.Doctor);
    }

    function mintAssistant(address account, string memory name, string memory surname, uint256 age) public onlyOwner {
        tokenIdCounter++;
        _mint(account, tokenIdCounter, 1, "");
        tokenRoles[tokenIdCounter] = RoleType.Assistant;
        tokenPersonalData[tokenIdCounter] = PersonalData(name, surname, age);
        // Initialize with empty permissions
        initializeHospitalAccess(tokenIdCounter);
    }

    function mintPatient(address account, string memory name, string memory surname, uint256 age) public onlyOwner {
        tokenIdCounter++;
        _mint(account, tokenIdCounter, 1, "");
        tokenRoles[tokenIdCounter] = RoleType.Patient;
        tokenPersonalData[tokenIdCounter] = PersonalData(name, surname, age);
        // Initialize with empty permissions
        initializeHospitalAccess(tokenIdCounter);
    }

    function initializeHospitalAccess(uint256 tokenId) internal {
        // Set empty permissions for each hospital upon minting
        for (uint256 i = H1; i <= H4; i++) {
            tokenHospitalAccessRights[tokenId].push(HospitalAccess({
                hospitalId: i,
                accessRights: new bytes(0) // Empty access rights
            }));
        }
    }


    function addAttribute(uint256 tokenId, string memory key, string memory value, bytes memory permissions) public onlyOwner {
        tokenAttributes[tokenId].push(Attribute({
            key: key,
            value: value,
            permissions: permissions
        }));
    }


    function updateAttribute(uint256 tokenId, uint256 attributeIndex, string memory key, string memory value) public onlyOwner {
        require(attributeIndex < tokenAttributes[tokenId].length, "Attribute does not exist.");
        Attribute storage attribute = tokenAttributes[tokenId][attributeIndex];
        attribute.key = key;
        attribute.value = value;
    }

    function removeAttribute(uint256 tokenId, uint256 attributeIndex) public onlyOwner {
        require(attributeIndex < tokenAttributes[tokenId].length, "Attribute does not exist.");
        Attribute[] storage attributes = tokenAttributes[tokenId];
        attributes[attributeIndex] = attributes[attributes.length - 1];
        attributes.pop();
    }

    // Function to update hospital access rights for a token
    function setHospitalAccess(uint256 tokenId, uint256 hospitalId, bytes memory accessRights) public onlyOwner {
        bool hospitalFound = false;
        for (uint256 i = 0; i < tokenHospitalAccessRights[tokenId].length; i++) {
            if (tokenHospitalAccessRights[tokenId][i].hospitalId == hospitalId) {
                tokenHospitalAccessRights[tokenId][i].accessRights = accessRights;
                hospitalFound = true;
                break;
            }
        }
        if (!hospitalFound) {
            tokenHospitalAccessRights[tokenId].push(HospitalAccess({
                hospitalId: hospitalId,
                accessRights: accessRights
            }));
        }
    }

    // Check if the given token has a specific permission in any of the associated hospitals
    function hasPermission(uint256 tokenId, uint8 permission) public view returns (bool) {
        Attribute[] storage attributes = tokenAttributes[tokenId];
        for (uint256 i = 0; i < attributes.length; i++) {
            // Loop through each bit in the permissions bytes array
            for (uint j = 0; j < attributes[i].permissions.length; j++) {
                if (uint8(attributes[i].permissions[j]) & permission == permission) {
                    return true;
                }
            }
        }
        return false;
    }


    function getRoleType(uint256 tokenId) public view returns (RoleType) {
        require(tokenId > 0 && tokenId <= tokenIdCounter, "Token does not exist."); // Updated to use tokenIdCounter
        require(tokenRoles[tokenId] != RoleType(0), "Token role not assigned."); // Additional check to ensure role is assigned
        return tokenRoles[tokenId];
    }


    // Modifier to check if the token has the update permission in any hospital
    modifier canUpdateEMR(uint256 tokenId) {
        require(hasPermission(tokenId, PERMISSION_UPDATE_EMR), "Access denied: Cannot update EMR.");
        _;
    }

    // Function to update EMR hash if the user has "U1" permission and the token represents a patient
    function updateEMRHash(uint256 tokenId, bytes32 newHash) public {
        // Check if the token exists and has "U1" permission in any associated hospital
        require(tokenHospitalAccessRights[tokenId].length > 0, "Token does not exist or has no hospital access rights.");
        require(hasPermission(tokenId, PERMISSION_UPDATE_EMR), "Access denied: User lacks U1 permission.");
        
        // Ensure the tokenId corresponds to a patient
        RoleType role = getRoleType(tokenId);
        require(role == RoleType.Patient, "EMR can only be updated for patients.");

        // Perform the update
        EMRHash storage emrHash = emrHashes[tokenId];
        emrHash.hash = newHash;
        emrHash.lastUpdated = block.timestamp; // Current block timestamp

        // Emit an event or take additional actions as needed
    }



    function updatePersonalData(uint256 tokenId, string memory name, string memory surname, uint256 age) public {
        require(msg.sender == owner(), "Only the owner can update their data");
        tokenPersonalData[tokenId] = PersonalData(name, surname, age);
    }

    // Override uri to include token access rights information for all associated hospitals
    function uri(uint256 tokenId) public view override returns (string memory) {
        HospitalAccess[] storage accesses = tokenHospitalAccessRights[tokenId];
        require(accesses.length > 0, "URI: nonexistent token");

        string memory baseURI = super.uri(tokenId);
        string memory accessRightsPart;

        for (uint256 i = 0; i < accesses.length; i++) {
            // You'll need to define how you want to represent each set of access rights
            accessRightsPart = string(abi.encodePacked(accessRightsPart, "hospital", accesses[i].hospitalId.toString(), "=", accesses[i].accessRights, "&"));
        }

        return string(abi.encodePacked(baseURI, "?", accessRightsPart));
    }


    // ... Additional functions and modifiers ...
}
